package manolete;

public class Miguel {
	int nombre;
	int apellidos;
	int dni;

	public Miguel() {
		super();
		// TODO Auto-generated constructor stub
	}
	public int getNombre() {
		return nombre;
	}
	public void setNombre(int nombre) {
		this.nombre = nombre;
	}
	public int getApellidos() {
		return apellidos;
	}
	public void setApellidos(int apellidos) {
		this.apellidos = apellidos;
	}
	public int getDni() {
		return dni;
	}
	public void setDni(int dni) {
		this.dni = dni;
	}

	
	
}
